namespace GaleriaZwierzat;

internal static class PicturesManager
{
    private static Picture? pictureToSave = null;

    public static void AddTitle(string title)
    {
        pictureToSave ??= new();
        pictureToSave.Title = title;
    }

    public static void SavePictureToDb(Picture picture)
    {
        pictureToSave!.PictureBase64 = picture.PictureBase64;

        // TODO: Make it autoincrement.
        pictureToSave.Id = 100;

        MockPictures!.Add(pictureToSave);
    }

    public static void DeletePictureFromDb(int id)
    {
        var picture = MockPictures.Single(x => x.Id == id);
        MockPictures.Remove(picture);
    }

    public static List<Picture> GetPicturesFromDb()
    {
        return MockPictures;
    }






    private static readonly List<Picture> MockPictures = [
        new Picture { Id = 1, Title = "picture 1", PictureBase64 = "" },
        new Picture { Id = 2, Title = "picture 2", PictureBase64 = "" },
        new Picture { Id = 3, Title = "picture 3", PictureBase64 = "" }
    ];
}
